import React from 'react';

function LandingPage1() {
  return (
    <div style={styles.pageContainer}>
      {/* Hero Section */}
      <section style={styles.heroSection}>
        <h1 style={styles.heroTitle}>Discover Our Latest Product</h1>
        <p style={styles.heroDescription}>
          Scan the QR code to get detailed information about our product.
        </p>
        <a href="#details" style={styles.ctaButton}>
          Learn More
        </a>
      </section>

      {/* Products Section */}
      <section style={styles.productsSection} id="products">
        <h2 style={styles.sectionHeading}>Our Products</h2>
        <p style={styles.sectionDescription}>
          Explore our latest products below and enjoy exclusive discounts with coupon codes!
        </p>

        {/* Product Items */}
        <div style={styles.productItems}>
          <div style={styles.productItem}>
            <img src="product1.jpg" alt="Product 1" style={styles.productImage} />
            <h3 style={styles.productTitle}>Product 1</h3>
            <p style={styles.productDescription}>A great product with amazing features.</p>
            <p style={styles.discountCode}>
              Use code <span style={styles.couponCode}>DISCOUNT10</span> for 10% off!
            </p>
          </div>
          <div style={styles.productItem}>
            <img src="product2.jpg" alt="Product 2" style={styles.productImage} />
            <h3 style={styles.productTitle}>Product 2</h3>
            <p style={styles.productDescription}>An amazing product for your needs.</p>
            <p style={styles.discountCode}>
              Use code <span style={styles.couponCode}>DISCOUNT20</span> for 20% off!
            </p>
          </div>
        </div>
      </section>

      {/* QR Code Section */}
      <section style={styles.qrSection} id="details">
        <h2 style={styles.sectionHeading}>Scan the QR Code</h2>
        <p style={styles.sectionDescription}>
          Scan the QR code to instantly access detailed product information, specifications, and benefits.
        </p>
        <div style={styles.qrCode}>
          <img
            src="qr-code-example.png"
            alt="QR Code"
            style={styles.qrCodeImage}
          />
        </div>
        <p style={styles.qrNote}>* Use your smartphone's camera to scan the code.</p>
      </section>
    </div>
  );
}

const styles = {
  // General Styles
  pageContainer: {
    width: '375px', // iPhone 6/7/8 width
    margin: '0 auto',
    transform: 'scale(1)', // For mobile scaling
    transformOrigin: 'top center', // Keeps the scale centered
    minHeight: '100%',
  },

  // Hero Section
  heroSection: {
    background: 'url("hero-background.jpg") center/cover no-repeat',
    color: '#fff',
    textAlign: 'center',
    padding: '50px 20px',
    backgroundSize: 'cover',
    height: '100vh',
    display: 'flex',
    flexDirection: 'column',
    justifyContent: 'center',
    alignItems: 'center',
  },
  heroTitle: {
    fontSize: '36px',
    fontWeight: 'bold',
    margin: '0',
  },
  heroDescription: {
    fontSize: '18px',
    margin: '10px 0 20px',
  },
  ctaButton: {
    textDecoration: 'none',
    backgroundColor: '#0073e6',
    padding: '12px 25px',
    color: '#fff',
    borderRadius: '5px',
    fontSize: '16px',
    display: 'inline-block',
    transition: 'background-color 0.3s ease',
  },

  // Products Section
  productsSection: {
    padding: '30px 20px',
    backgroundColor: '#fff',
    textAlign: 'center',
  },
  sectionHeading: {
    fontSize: '28px',
    marginBottom: '20px',
  },
  sectionDescription: {
    fontSize: '16px',
    marginBottom: '30px',
  },
  productItems: {
    display: 'flex',
    justifyContent: 'center',
    gap: '20px',
    flexWrap: 'wrap',
  },
  productItem: {
    backgroundColor: '#f4f4f4',
    padding: '20px',
    borderRadius: '10px',
    textAlign: 'center',
    width: '150px', // Limit the width for better responsiveness
    marginBottom: '30px',
    boxSizing: 'border-box',
  },
  productImage: {
    width: '100%',
    height: 'auto',
    borderRadius: '10px',
  },
  productTitle: {
    fontSize: '20px',
    margin: '15px 0',
  },
  productDescription: {
    fontSize: '14px',
    color: '#555',
    marginBottom: '10px',
  },
  discountCode: {
    fontSize: '14px',
    fontWeight: 'bold',
  },
  couponCode: {
    backgroundColor: '#0073e6',
    color: '#fff',
    padding: '5px 10px',
    borderRadius: '5px',
  },

  // QR Section
  qrSection: {
    padding: '30px 20px',
    backgroundColor: '#fff',
    textAlign: 'center',
  },
  qrCodeImage: {
    width: '200px',
    height: '200px',
    borderRadius: '10px',
    marginBottom: '20px',
  },
  qrNote: {
    fontSize: '14px',
    color: '#555',
  },

  // Hover Effect for CTA Button
  ctaButtonHover: {
    backgroundColor: '#005bb5',
  },
};

// Hover Effect using JavaScript (react-specific)
const HoverButton = () => {
  return (
    <a
      href="#details"
      style={styles.ctaButton}
      onMouseEnter={(e) => (e.target.style.backgroundColor = styles.ctaButtonHover.backgroundColor)}
      onMouseLeave={(e) => (e.target.style.backgroundColor = '#0073e6')}
    >
      Learn More
    </a>
  );
};

export default LandingPage1;
